import React, { Component } from 'react';
import { connect } from 'react-redux';
import './Specialty.scss';
import './HomeFooter.scss';
 
class HomeFooter extends Component {
    render() {
        return (
           <div className='home-footer'>
               <div className='footer-contanier'>
                   </div>
             <div className='home-footer-logo'></div>
             <div className='home-footer-content'>
                 <div className='home-footer-content-header'>
                     Medical Booking
                 </div>
                 <div className='home-footer-description'>
                     Sức khỏe là nụ cười, chúng tôi xin mang đến nụ cười cho bạn
                 </div>
                 <div className='home-footer-intro'>
                     website được phát triên bới nhóm sinh viên Đại học Cần Thơ
                 </div>
             </div>
           </div>
        );
    }

} 

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language,
    };
    
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeFooter);
